create table AUD_AUDITORIA (
	tabla                           varchar2(30 byte)                      not null  ,
    codigo                          varchar2(50 byte)                      not null   ,
	movimiento                      number(10,0)                      not null  ,        
	audit_Usuario                    varchar2(25 byte)                          null  ,
	audit_fecha                     datetime                             null  ,
	audit_Tipo                       varchar2(10 byte)                          null  ,
	valor_Original                   CLOB                                 null  ,
	valor_Final                      CLOB                                 null  	
)
create table AUD_ERROR (
	anio                number(10,0) not null,
	mes                 number(10,0) not null,
	dia                 number(10,0) not null,
	movimiento          number(10,0) not null,
	class_Name           varchar2(250 byte) null,	
	function_Name        varchar2(100 byte) null,
	message             varchar2(250 byte) null,
	cause               varchar2(250 byte) null,
	line_Number          number(10,0) null,	
	detail              CLOB null,			
	audit_Usuario        varchar2(25 byte) null  ,
	audit_fecha          datetime    null  	
)


create table GEN_BOTON (
	boton_Id                         number(10,0)                              not null  ,
	nombre                          varchar2(150 byte)                     not null  ,
	icon                            varchar2(30 byte)                          null  ,
	action                          varchar2(100 byte)                         null  ,
	activo                          number(1,0)                        not null  ,
	audit_Usuario_Creacion            varchar2(25 byte)                      not null  ,
	audit_Usuario_Modifica            varchar2(25 byte)                      null,
	audit_fecha_Creacion              TIMESTAMP(6)                      not null  ,
	audit_fecha_Modifica              TIMESTAMP(6)                      null  
)


create table GEN_CONFIG (
    config_Id                        varchar2(25 byte)                      not null  ,
	concepto                        varchar2(100 byte)                     not null  ,
	system_Id                        number(10,0)                              not null  ,
	system_Version                   varchar2(20 byte)                      not null  ,
	system_Date                      date                             not null  ,
	system_Date_Created               date                             not null  ,
	repository                      varchar2(200 byte)                     null  ,
	type_Document                    varchar2(100 byte)                     not null  ,
	type_Image                       varchar2(100 byte)                     not null  ,
	size_Document                    number(10,0)                              not null  ,
	size_Image                       number(10,0)                              not null  ,
	web_Service_Security              varchar2(200)                          null  ,
	web_Service_Pide                  varchar2(200)                         null  ,
	type_Document_Label               varchar2(150 byte)                         null  ,
	type_Image_Label                  varchar2(150 byte)                         null  ,
	ldap_Url                         varchar2(150 byte)                         null  ,
	ldap_Domain                      varchar2(80 byte)                          null  ,
	smtp_host                        varchar2(16 byte)                          null  ,
	activo                          number(1,0)                             DEFAULT  1 not null  ,
	limit_Document                   number(10,0)                                  null  ,
	limit_Image                      number(10,0)                                  null  ,
	limit_Row                        number(10,0)                                  null  ,
	secret_Key                       varchar2(100 byte)                          null  ,
	secret_KeySpec                   varchar2(50 byte)                          null  ,
	logo_Path                        varchar2(150 byte)                         null  ,
	logo_Path_Relative              number(1,0)                             DEFAULT  0  not null  ,
	url_Sistema_Remoto                varchar2(100 byte)                         null  ,
	analytics                       varchar2(20 byte)                          null  , 
        flag_Reporte_Relative             number(1,0) default 0   not null  
)




create table GEN_MENU (
	menu_Id                          number(10,0)                              not null  ,
	nombre                          varchar2(150 byte)                     not null  ,
	tipo                            varchar2(1 byte)                           null  ,
	menu_Padre                       number(10,0)                                  null  ,
	url                             varchar2(100 byte)                         null  ,
	command                         varchar2(100 byte)                         null  ,
	icon                            varchar2(50 byte)                          null  ,
	ajax                            number(1,0)                              not null  ,
	updated                         varchar2(50 byte)                          null  ,
	nivel                           number(10,0)                              not null  ,
	orden                           number(10,0)                                  null  ,
	activo                          number(1,0)                              not null  ,
	audit_Usuario_Creacion            varchar2(25 byte)                      not null  ,
	audit_Usuario_Modifica            varchar2(25 byte)                      null,
	audit_fecha_Creacion              TIMESTAMP(6)                      not null  ,
	audit_fecha_Modifica              TIMESTAMP(6)                      null  
)



create table GEN_PERFIL (
	perfil_Id                        number(10,0)                              not null  ,
	nombre                          varchar2(50 byte)                      not null  ,
	activo                          number(1,0)                              not null  ,
	perfil_Padre                     number(10,0)                                  null  ,
	flag_Only_Node                    number(1,0)                              not null  ,
	orden                           number(10,0)                              not null  ,
	audit_Usuario_Creacion            varchar2(25 byte)                      not null  ,
	audit_Usuario_Modifica            varchar2(25 byte)                      null,
	audit_fecha_Creacion              TIMESTAMP(6)                      not null  ,
	audit_fecha_Modifica              TIMESTAMP(6)                      null  
)


create table GEN_PERFIL_MENU (
	perfil_Id                        number(10,0)                              not null  ,
	menu_Id                          number(10,0)                              not null  ,
	audit_Usuario_Creacion            varchar2(25 byte)                      not null  ,
	audit_Usuario_Modifica            varchar2(25 byte)                      null,
	audit_fecha_Creacion              TIMESTAMP(6)                      not null  ,
	audit_fecha_Modifica              TIMESTAMP(6)                      null     
)



create table GEN_USUARIO (
	login                           varchar2(25 byte)                      not null  ,
	clave                           varchar2(60 byte)                      not null  ,
	nombre_Completo                  varchar2(80 byte)                          null  ,
	email                           varchar2(150 byte)                         null  ,
	dni                             varchar2(8 byte)                           null  ,
	foto                            varchar2(30 byte)                          null  ,
	perfil_Id                        number(10,0)                                  null  ,
	activo                          number(1,0)                              not null  ,
	flag_LDAP                        number(1,0)                              not null  ,
	interno                         number(1,0)                              not null  ,
	fecha_Inicio                     DATE                             null  ,
	fecha_Fin                        DATE                             null  ,
	audit_Usuario_Creacion            varchar2(25 byte)                      not null  ,
	audit_Usuario_Modifica            varchar2(25 byte)                      null,
	audit_fecha_Creacion              TIMESTAMP(6)                      not null  ,
	audit_fecha_Modifica              TIMESTAMP(6)                      null  
)

create table GEN_FILE_CONTROL (
	fileControl_Id                   number(10,0)                              not null  primary key,
	nombre                          varchar2(80 byte)                      not null  ,
	tipo                            varchar2(150 byte)                         null  ,
	etiqueta                        varchar2(150 byte)                         null  ,
	directorio                      varchar2(150 byte)                         null  ,
	tamano                          number(10,0)                                  null  ,
	cantidad                        number(10,0)                                  null   
)

create table GEN_MASTER_METADATA (
	metadata_Id                      number(10,0) not null  primary key,
	tabla                           varchar2(30 BYTE) not null  ,
	alias_Tabla                     varchar2(80 BYTE) not null  ,
	columnaPK                       varchar2(60 BYTE) not null  ,
	maxima_Longitud_Nombre            number(10,0) null  ,
	flag_Nombre_Masculino             number(1,0)DEFAULT  1 not null  ,
	etiqueta_Plural                  varchar2(80 BYTE) null  ,
	etiqueta_Singular                varchar2(80 BYTE) null  ,
	flag_Auditable                   number(1,0)DEFAULT  1   not null  ,
	flag_Restringido                 number(1,0)DEFAULT  0   not null  ,
	tablaFK                         varchar2(30 BYTE) null  ,
	etiquetaFK                      varchar2(80 BYTE) null  ,
	columnaFK                       varchar2(60 BYTE) null  ,
	vigente                         number(1,0)DEFAULT  1 not null  ,
	audit_Usuario_Creacion            varchar2(25 BYTE) not null  ,
	audit_Fecha_Creacion              TIMESTAMP(6) not null  ,
	audit_Usuario_Modifica            varchar2(25 BYTE) null  ,
	audit_Fecha_Modifica              TIMESTAMP(6) null   
)


alter table AUD_AUDITORIA add primary key(tabla, codigo, movimiento)
alter table AUD_ERROR add primary key(anio, mes, dia, movimiento)
alter table GEN_BOTON add primary key(boton_Id)
alter table GEN_CONFIG add primary key(config_Id)
alter table GEN_MENU add primary key(menu_Id)
alter table GEN_PERFIL add primary key(perfil_Id)
alter table GEN_PERFIL_MENU add primary key(perfil_Id,menu_Id)
alter table GEN_USUARIO add primary key(login)
alter table GEN_USUARIO add foreign key(perfil_Id) references GEN_PERFIL(perfil_Id)
alter table GEN_PERFIL_MENU add foreign key(perfil_Id) references GEN_PERFIL(perfil_Id)
alter table GEN_PERFIL_MENU add foreign key(menu_Id) references GEN_MENU(menu_Id)











